import React from "react";
import Items from './Table'

export default function MainWindow(props) {
  const title = props.title,
        items = props.items;

  return (
    <section>
      <h2>{title}</h2>
      {/* {items
        ? items.map((item,key) => <Items item={item} key={key}/>)
        : console.log("loading")} */}
    </section>
  );
}
